import React from 'react';
import "./footer.css";
import { useMediaQuery } from 'react-responsive';
import MenuIcon from '@mui/icons-material/Menu';

export default function NavBar() {
  const isDesktopOrLaptop = useMediaQuery({
    query: '(min-width: 811px)'
  })

  const isTabletOrMobile = useMediaQuery({
      query: '(max-width: 810px) and (min-width: 711px)'
  })

  const isPorttrait = useMediaQuery({
      query: '(max-width: 710px)'
  })

return (
<div>
    {isDesktopOrLaptop && 
      <div>
        <div className="footer-l">
          <div className="footerBox-l">
            <h2 className="footerBoxTitle">Contact Us</h2>
          </div>

          <div className="footerBox-l">
            <h2 className="footerBoxTitle">Follow Us</h2>
          </div>

          <div className="footerBox-l">
            <h2 className="footerBoxTitle">Home</h2>
            <h2 className="footerBoxTitle">Exam Calander</h2>
            <h2 className="footerBoxTitle">About Us</h2>
            <h2 className="footerBoxTitle">Log In</h2>
            <h2 className="footerBoxTitle">Register</h2>
          </div>

        </div>
      </div>
    }
    {isTabletOrMobile && <p></p>}
    {isPorttrait && <p></p>}
</div>
)
}
